import React, { Component } from 'react';
import "../../Css/Applicant.css";
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from "react-router-dom";
import {   Link } from "react-router-dom";



 class Applicant extends Component {

 
      // onSeeApplicantsClick() {
      //     this.props.applicants( this.props.history);
      //    }

  
    
     
   render() {
       const {project} = this.props;
     return(
     <div classname="applicant" >
  
     {project.map((projectData, i) =>
             <div className="applicantList" key={i}> 
                  <ul>{projectData.applicants.map(skills => (
                     <li>{skills.user}</li> 
                 ))}
                
                 </ul> 
                    <Link to="/applicants" style={{textDecoration:0}}>
                      <button type="button" className="visitProfile" >Visit Profile</button>
                   </Link>
                   <Link to="/applicants" style={{textDecoration:0}}>
                      <button type="button" className="visitProfile" >Message User</button>
                   </Link>
                       
            </div>
         )}
  </div>
  )
   }
}

Applicant.propTypes = {
  applicants: PropTypes.func.isRequired,

 
};

const mapStateToProps = (state) => ({
});

export default connect(mapStateToProps, {   })(withRouter(Applicant));
